import React from 'react'
import { useState } from 'react'
import { styled, useTheme } from '@mui/material/styles'
import MuiAppBar, { AppBarProps as MuiAppBarProps } from '@mui/material/AppBar';
import { IconButton, Toolbar, Typography, Stack, Button, Menu, MenuItem, Box, Drawer } from "@mui/material"
import { Link } from 'react-router-dom';
import BiotechIcon from '@mui/icons-material/Biotech'
import MenuIcon from '@mui/icons-material/Menu'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown'
const drawerWidth = 240;

const Main = styled('main', { shouldForwardProp: (prop) => prop !== 'open' })<{
  open?: boolean;
}>(({ theme, open }) => ({
  flexGrow: 1,
  padding: theme.spacing(3),
  transition: theme.transitions.create('margin', {
    easing: theme.transitions.easing.sharp,
    duration: theme.transitions.duration.leavingScreen,
  }),
  marginRight: -drawerWidth,
  ...(open && {
    transition: theme.transitions.create('margin', {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
    marginRight: 0,
  }),
}));

interface AppBarProps extends MuiAppBarProps {
  open?: boolean;
}

const AppBar = styled(MuiAppBar, {
  shouldForwardProp: (prop) => prop !== 'open',
})<AppBarProps>(({ theme, open }) => ({
  transition: theme.transitions.create(['margin', 'width'], {
    easing: theme.transitions.easing.sharp,
    duration: theme.transitions.duration.leavingScreen,
  }),
  ...(open && {
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(['margin', 'width'], {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
    marginRight: drawerWidth,
  }),
}));

const DrawerHeader = styled('div')(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  padding: theme.spacing(0, 1),
  // necessary for content to be below app bar
  ...theme.mixins.toolbar,
  justifyContent: 'flex-start',
}));

export const Navbar = () => {
    const [anchorEl, setAchorEl] = useState<null | HTMLElement>(null)
    const openUI = Boolean(anchorEl)
    const [openDrawer, setOpenDrawer] = useState(false)

    const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
        setAchorEl(event.currentTarget)
    }

    const handleClose = () => {
        setAchorEl(null)
    }

    const handleDrawerOpen = () => {
        setOpenDrawer(true)
    }
    const handleDrawerClose = () => {
        setOpenDrawer(false)
    }

    const toggleDrawer = 
        (open: boolean) => 
        (event: React.KeyboardEvent | React.MouseEvent ) => {
            console.log(open)
            if (
                event.type  === 'keydown' &&
                ((event as React.KeyboardEvent).key === 'Tab' ||
                    (event as React.KeyboardEvent).key === 'Shift')
            ) {
                return
            }
            setOpenDrawer(open)
        }
    const contentDrawer = () => (
        <Box
            sx={{ width: 350}}
            role='presentation'
            onClick={toggleDrawer(false)}
            onKeyDown={toggleDrawer(false)}
        >
            Drawer Content
        </Box>
    )

    return (
        <Box sx={{ display: 'flex'}}>
            <AppBar position='fixed' open={openDrawer}>  
                <Toolbar>
                    <IconButton size='large' edge='start' color='inherit' aria-label='logo'>
                        <BiotechIcon/>
                    </IconButton>
                    <Typography noWrap variant='h6' component='div' sx={{flexGrow: 1}}>
                        GENE-Works
                    </Typography>
                    <Stack direction='row' spacing={2}>
                        <Button color='inherit' component={Link} to='/graph'>Graph 1</Button>
                        <Button color='inherit'>Graph 2</Button>
                        <Button id='ui-button'
                            color='inherit'
                            onClick={handleClick}
                            aria-control={openUI ? 'ui-menu': undefined}
                            aria-haspopup='true'
                            aria-expanded={openUI ? 'true' : undefined}
                            endIcon={<KeyboardArrowDownIcon/>}
                        >UI</Button>
                    </Stack>
                    <Menu id='ui-menu' 
                        anchorEl={anchorEl}
                        open={openUI}
                        MenuListProps={{
                            'aria-labelledby': 'ui-button'
                        }}
                        onClose={handleClose}
                        anchorOrigin={{
                            vertical:'bottom',
                            horizontal:'right',
                        }}
                        transformOrigin={{
                            vertical: 'top',
                            horizontal: 'right'

                        }}
                    >
                        <MenuItem 
                            component={Link} 
                            to='/exbox' 
                            onClick={handleClose} 
                        >Box</MenuItem>
                        <MenuItem 
                            component={Link} 
                            to='/exstack'
                            onClick={handleClose}
                        >Stack</MenuItem>
                        <MenuItem 
                            component={Link} 
                            to='/exgrid'
                            onClick={handleClose}
                        >Grid</MenuItem>
                    </Menu>
                    <IconButton
                        color='inherit'
                        aria-label='open drawer'
                        edge='end'
                        onClick={handleDrawerOpen}
                        sx={{ ...(openDrawer && {display:'none'}) }}
                    >
                        <MenuIcon/>
                    </IconButton>

                </Toolbar>
            </AppBar>
        </Box>
    )
}
